plt.plot(t1,s1)
plt.xlabel('Time (s)')
plt.ylabel('Voltage (mV)')
plt.title('Cos (Blue)/Sin (Red) Plot (Note Phase Difference)')
plt.xlim(0,52.5)
plt.ylim(-1,1)
plt.yticks(set_ticks_array(-2,2,0.5))
plt.xticks(set_ticks_array(0,60,10))
plt.grid()

plt.show()

